export default function ProjectList({curState, updateCurState, verticalMode}) {
    return (
    <>
    <section id="project-list">
        <div className="separator"></div>
        <div className={`center-wrapper plist ${verticalMode ? "" : "thin"}`}>
            <ProjectIcons curState={curState} updateCurState={updateCurState} verticalMode={verticalMode}/>
        </div>
    </section>
    </>
    );
}

function ProjectIcons({curState, updateCurState, verticalMode}) {
    let table = (<div id="project-table" className={verticalMode ? "" : "thin"}>
        {Object.keys(curState.projInfoList).map(projectKey => {
            let projectInfo = curState.projInfoList[projectKey];
            
            return (
            <div className="project-icon-wrapper" onPointerDown={e => {
                curState.projNum = projectKey;
                console.log(projectKey);
                }} key={projectKey}>
                <div className="project-title">{projectInfo.title}</div>
                <img className={`project-image ${verticalMode ? "" : "thin"}`} src={projectInfo.imgsrc} alt={projectInfo.title + " icon"} />
            </div>);
        })}
    </div>);

    return table;
}
